import React, { Component } from "react";



class ChartActivities extends Component {
    constructor(props) {
      super(props)
    }

    calculate(repo, following, followers) {
      if (repo >= following && repo >= followers) {
        return "Codeur";
      }
      if (following > repo && following > followers) {
        return "Messie";
      }
      if (followers > repo && followers > following) {
        return "Suiveur";
      }
    }

    render() {
      return (
        <div>
          <h3>Activités</h3>
          <p>
            L'utilisateur est plutôt un:{" "}
            {this.calculate(
              this.props.public_repos_number,
              this.props.following_count,
              this.props.followers_count
            )}
          </p>
          <div className="chartActivities">
            <Pie
              data={this.state.chartData}
              width={200}
              height={200}
              options={{
                maintainAspectRatio: false,
                legend: {
                  labels: {
                    fontColor: "white",
                    fontSize: 18
                  }
                }
              }}
            />
          </div>
        </div>
      );
    }
  }

  export default ChartActivities;
